pragma solidity >= 0.5.6;
pragma experimental ABIEncoderV2;

import "../open/utils/Initializable.sol";
import "../open/utils/Ownable.sol";
import "../nftLib/FishNftFactory.sol";
import "../open/token/ERC721/IERC721.sol";
import "../open/token/ERC721/utils/ERC721Holder.sol";
import "../open/token/ERC1155/IERC1155.sol";
import "../open/token/ERC1155/utils/ERC1155Holder.sol";


contract Ngrowth is Initializable,Ownable,ERC721Holder,ERC1155Holder{

    ///////鱼塘
   struct Pond{
       uint totalSpace;     //总空间
       uint surplusSpace;   //剩余空间
   }

   mapping(address => Pond) public pondMap;

   uint internal ORDER_ID;

   struct FishFry{
       uint id;             //订单ID
       uint startTime;
       address feeder;
       uint level;          //鱼苗级别  
       uint surplusgCycle;  //剩余生长周期
       mapping(uint => uint) feedLimitMap;  //鱼食投放限制
       mapping(uint => uint) ogxgenLimitMap;//氧气投放限制
   }

    mapping( uint => FishFry) public fryMap;  //订单信息

    uint[] fryIds;      //全网订单

    //id => index
    mapping( uint => uint) internal fryId2Indexs;

    mapping(address => uint[]) userFryIds;  //用户订单

    //id = > index
    mapping( uint => uint) internal userFryId2Indexs;

    ///////鱼卡
    FishNftFactory public fishFactory;
    IERC721 public fishAddress;

    //////鱼食
    FoodNftFactory public foodFactory;
    IERC1155 public foodAddress;

    /////鱼池
    SpaceNftFactory public spaceFactory;
    IERC1155 public spaceAddress;

    /////鱼苗
    FishFryNftFactory public fishFryFactory;  
    IERC1155 public fishFryAddress;

    /////氧气
    OxygenNftFactory public oxygenFactory;  
    IERC1155 public oxygenAddress;

    struct Result{
        address nft;        //获得的nft
        uint id;            //代币Id
        uint amount;        //数量
    }
    mapping(bytes32 => Result) public harvestResults;

    uint public addGrowthCycle;

    struct FryInfo{
       uint id;                 //订单ID
       uint level;              //鱼苗等级
       uint startTime;          //放养时间
       uint surplusgCycle;      //剩余生长周期，秒数
       uint surplusFoodLimit;   //可投鱼食次数
       uint surplusOxygenLimit; //可增养次数
    }
    constructor() public {}

    function initialize(
        address _fishFactory,
        address _fishAddress,
        address _foodFactory,
        address _foodAddress,
        address _spaceFactory,
        address _spaceAddress,
        address _fishFryFactory,
        address _fishFryAddress,
        address _oxygenFactory,
        address _oxygenAddress,
        address _ownerAddress
    ) public initializer {
        ORDER_ID = 100000000;
        fishFactory = FishNftFactory(_fishFactory);
        fishAddress = IERC721(_fishAddress);
        foodFactory = FoodNftFactory(_foodFactory);
        foodAddress = IERC1155(_foodAddress);
        spaceFactory = SpaceNftFactory(_spaceFactory);
        spaceAddress = IERC1155(_spaceAddress);
        fishFryFactory = FishFryNftFactory(_fishFryFactory);
        fishFryAddress = IERC1155(_fishFryAddress);
        oxygenFactory = OxygenNftFactory(_oxygenFactory);
        oxygenAddress = IERC1155(_oxygenAddress);
        addGrowthCycle = 1987200;
        _owner = _ownerAddress;
    }

    //用户订单
    function getUserFryInfos() external view returns(FryInfo[] memory _infos) {

        uint[] storage ids  = userFryIds[msg.sender];

        uint len = ids.length;

        _infos = new FryInfo[](len);

        uint time = block.timestamp / 1 days * 1 days;

        for( uint i = 0; i < len; i++ ){

            FishFry storage fry = fryMap[ids[i]];

            _infos[i].id = fry.id;
            _infos[i].level = fry.level;
            _infos[i].startTime = fry.startTime;
            _infos[i].surplusgCycle = fry.surplusgCycle;
            _infos[i].surplusFoodLimit = 10 - fry.feedLimitMap[time];
            _infos[i].surplusOxygenLimit = 10 - fry.ogxgenLimitMap[time];
        }
    }

    function getOrderInfo(address owner)external view returns(uint[] memory ids,uint[] memory myIds){
        ids = fryIds;
        myIds = userFryIds[owner];
    }

    function getId2Index(uint id)external view returns(uint index,uint myIndex){
        index = fryId2Indexs[id];
        myIndex = userFryId2Indexs[id];
    }

    //饲养鱼苗
    function feeding(uint nftId)external{

        fishFryAddress.safeTransferFrom(msg.sender, address(this), nftId, 1, "");

        FishPart.FishFryConfig memory config = fishFryFactory.getConfig(nftId);

        Pond storage pond = pondMap[msg.sender];

        require( pond.surplusSpace >= config.occupySpace,"space lock");
        pond.surplusSpace -= config.occupySpace;

        uint id =  ORDER_ID;

        fryMap[id] =  FishFry(
            id,
            block.timestamp,
            msg.sender,
            nftId,
            config.growthCycle + addGrowthCycle
        );

        //全局订单数据
        uint len = fryIds.length;

        if( len == 0 ){
            fryIds.push(0);
            len += 1;
        }

        fryIds.push(id);
        fryId2Indexs[id] = len;

        uint[] storage myIds = userFryIds[msg.sender];

        //个人订单数据
        len = myIds.length;

        if( len == 0 ){
            myIds.push(0);
            len += 1;
        }

        myIds.push(id);
        userFryId2Indexs[id] = len;

        ORDER_ID ++;
    }

    //增加鱼塘空间
    function addSpace(uint id,uint amount)external{

        spaceAddress.safeTransferFrom(msg.sender, address(this), id, amount, "");

        FishPart.SpaceConfig memory config =  spaceFactory.getConfig(id);

        Pond storage pond = pondMap[msg.sender];

        pond.surplusSpace += config.spaceValue * amount;
        pond.totalSpace += config.spaceValue * amount;
    }

    //投食
    function feed(uint foodId,uint foodAmount,uint fryId)external{

        foodAddress.safeTransferFrom(msg.sender, address(this), foodId, foodAmount, "");

        FishPart.FoodConfig memory config = foodFactory.getConfig(foodId);

        FishFry storage fry = fryMap[fryId];

        uint time = block.timestamp / 1 days * 1 days;

        require(fry.feedLimitMap[time] + foodAmount < 10,"exceed limit");

        fry.feedLimitMap[time] += foodAmount;

        uint subCycle = config.speedGrowth * foodAmount;

        if( fry.surplusgCycle > subCycle ){
            fry.surplusgCycle -= subCycle;
        }else{
            fry.surplusgCycle = 0;
        }
    }

    //增加氧气
    function oxygen(uint oxyId,uint oxyAmount,uint fryId)external{
        oxygenAddress.safeTransferFrom(msg.sender, address(this), oxyId, oxyAmount, "");

        FishPart.OxygenConfig memory config = oxygenFactory.getConfig(oxyId);

        FishFry storage fry = fryMap[fryId];

        uint time = block.timestamp / 1 days * 1 days;
        require(fry.ogxgenLimitMap[time] + oxyAmount< 10,"exceed limit");

        fry.ogxgenLimitMap[time] += oxyAmount;

        uint subCycle = config.speedGrowth * oxyAmount;

        if( fry.surplusgCycle > subCycle ){
            fry.surplusgCycle -= subCycle;
        }else{
            fry.surplusgCycle = 0;
        }
    }

    function _checkIsFinish(FishFry storage fry)internal view returns(bool){
        uint time = block.timestamp;
        return fry.startTime + fry.surplusgCycle <= time;
    }
    //收获
    function harvest(uint fryId,bytes32 flag)external{

        FishFry storage fry = fryMap[fryId];

        require( fry.surplusgCycle == 0 || _checkIsFinish(fry) ,"not finish" );

        uint tokenId = fishFactory.mint(fry.feeder,fry.level);

        harvestResults[flag] = Result(
            address(fishAddress),tokenId,0
        );

        _updateAcutionOrder(fryId,fry.feeder);
    }

     function _updateAcutionOrder(uint orderId,address owner)internal{

        uint len1 = fryIds.length;
        uint index1 = fryId2Indexs[orderId];

        require(index1 > 0 ,"not exist");

        fryIds[index1] = fryIds[len1-1];
        delete fryIds[len1 - 1];
        fryIds.pop();

        if( index1 != len1 - 1 ){
            fryId2Indexs[fryId2Indexs[index1]] = index1;
        }

        uint[] storage ids = userFryIds[owner];

        uint len2 = ids.length;

        uint index2 = userFryId2Indexs[orderId];
        require(index2 > 0 ,"not owner");

        ids[index2] = ids[len2 - 1];
        delete userFryIds[owner][len2 - 1];
        userFryIds[owner].pop();

        if( index2 != len2 - 1){
            userFryId2Indexs[ids[index2]] = index2;
        }
    }

}
